const LoginModal = () => {
    return(
        <div className="container">
            <div className="non_form">
                <p>Login</p>
                <p>Crea tu usuario y disfruta de todas sus ventajas</p>
            </div>
            <div className="form">
                <label>Nombre</label>
                <input></input>
                <label>Email</label>
                <input></input>
                <label>Password</label>
                <input></input>
                <button>Login</button>
            </div>

        </div>

    );
};

export default LoginModal;
